
import {  WebDriver, OpenFinProxy } from '@openfin/automation-helpers';
//import { expect } from 'chai';
import { topMenu } from './Menus/topMenuItems'
//import { Platform } from 'openfin/_v2/api/platform/platform';
const topMenuIns = new topMenu();
import { sideMenu } from './Menus/sideMenuItems'
const sideMenuIns = new sideMenu();


let image = ''
// declare var fin:any;

describe('Health Check page', function() {
        const healthCheckTitle = 'OpenFin Deployment Health Check';

        it(`Switch to ${healthCheckTitle}`, async () => {
            await WebDriver.waitForWindow('title', healthCheckTitle, 5000);
            const title = await WebDriver.getTitle();
            expect(title).toBe(healthCheckTitle);
            //assert.(title,  healthCheckTitle);
        });

        it('validate runtime status and version', async () => {
            await WebDriver.sleep(5000)
            await topMenuIns.validateRuntimeStatus("33.116.77.11");
        });


        it('Wait for OpenFin API ready', async () => {
            await WebDriver.waitForObjectExisting('fin.desktop', 5000);
        });

    });


    it("C24828 - Write image using clipboard api", async () => {
 
        const healthCheckTitle = 'OpenFin Deployment Health Check';
        await WebDriver.switchToWindow('title', healthCheckTitle);
        await WebDriver.sleep(5000)
        const fin = await OpenFinProxy.fin();
        await fin.Clipboard.writeImage({image});
        const result = await fin.Clipboard.getAvailableFormats();
        expect(result).toContain('image/png')
        console.log(result);

    });

    it("C24829 - Read image using clipboard api", async () => {
 
        const healthCheckTitle = 'OpenFin Deployment Health Check';
        await WebDriver.switchToWindow('title', healthCheckTitle);
        await WebDriver.sleep(5000)
        const fin = await OpenFinProxy.fin();
        await fin.Clipboard.writeImage({image});
        let paint_result = await fin.System.launchExternalProcess({path:'mspaint'})
        expect(paint_result.uuid).toBeDefined();
        await sideMenuIns.paste()
        await sideMenuIns.dont_save()
        await sideMenuIns.saveConfirm()
        let  result = await fin.Clipboard.getAvailableFormats();
        expect(result).toContain('image/png')
        console.log(result);
        let read = await fin.Clipboard.readImage({format:'jpg', quality :10})
        expect(read).toBeDefined();
        let read_length = read.length;
        let image_lenght = image.length;
        expect(read_length).toBeLessThan(image_lenght)
        image = read;
        await fin.Clipboard.writeImage({image});
        paint_result = await fin.System.launchExternalProcess({path:'mspaint'})
        expect(paint_result.uuid).toBeDefined();
        await sideMenuIns.paste()
        await sideMenuIns.dont_save()
        await sideMenuIns.saveConfirm()

        read = await fin.Clipboard.readImage({format:'jpg', quality :100})
        expect(read).toBeDefined();
        read_length = read.length;
        image_lenght = image.length;
        expect(read_length).toBeGreaterThan(image_lenght)
        image = read;
        await fin.Clipboard.writeImage({image});
        paint_result = await fin.System.launchExternalProcess({path:'mspaint'})
        expect(paint_result.uuid).toBeDefined();
        await sideMenuIns.paste()
        await sideMenuIns.dont_save()
        await sideMenuIns.saveConfirm()


        read = await fin.Clipboard.readImage({format:'jpg', quality :-15})
        expect(read).toBeDefined();
        read_length = read.length;
        image_lenght = image.length;
        expect(read_length).toBeLessThan(image_lenght)
        image = read;
        await fin.Clipboard.writeImage({image});
        paint_result = await fin.System.launchExternalProcess({path:'mspaint'})
        expect(paint_result.uuid).toBeDefined();
        await sideMenuIns.paste()
        await sideMenuIns.dont_save()
        await sideMenuIns.saveConfirm()


        read = await fin.Clipboard.readImage({ format: 'bmp'})
        expect(read).toBeDefined();
        read_length = read.length;
        image_lenght = image.length;
        expect(read_length).toBeGreaterThan(image_lenght)
        


        read = await fin.Clipboard.readImage({format:'png'})
        expect(read).toBeDefined();
        read_length = read.length;
        image_lenght = image.length;
        expect(read_length).toBeGreaterThan(image_lenght)
        image = read;
        await fin.Clipboard.writeImage({image});
        paint_result = await fin.System.launchExternalProcess({path:'mspaint'})
        expect(paint_result.uuid).toBeDefined();
        await sideMenuIns.paste()
        await sideMenuIns.dont_save()
        await sideMenuIns.saveConfirm()

    });

